import React, { useState } from 'react';
import './navbar.css';
import menu from '../../assets/menu.png';

const Navbar = () => {
  const [showMenu, setShowMenu] = useState(false);

  return (
    <nav className='navbar'>
      <a href="https://maseelshah.com" className='logo'>
        <div style={{ fontFamily: 'Apple Chancery', color: 'white' }}>
          MaseelShah
        </div>
      </a>

      <img src={menu} alt='Menu' className='mobMenu' onClick={() => setShowMenu(!showMenu)} />

      <div className={`navMenu ${showMenu ? 'open' : ''}`}>
        <Link to='intro' spy={true} smooth={true} offset={-100} duration={500} className='listItem' onClick={() => setShowMenu(false)}>
          Home
        </Link>
        <Link to='skills' spy={true} smooth={true} offset={-50} duration={500} className='listItem' onClick={() => setShowMenu(false)}>
          About
        </Link>
        <Link to='works' spy={true} smooth={true} offset={-50} duration={500} className='listItem' onClick={() => setShowMenu(false)}>
          Portfolio
        </Link>
        <Link to='contactPage' spy={true} smooth={true} offset={-100} duration={500} className='listItem' onClick={() => setShowMenu(false)}>
          Contact Me
        </Link>
      </div>
    </nav>
  );
};

export default Navbar;
